(12, 4, 5, '', 'visi-misi', 'Visi Misi', '<p><span style=\"font-weight: 400;\">Visi dan Misi</span></p>\r\n<h3><strong>Visi</strong></h3>\r\n<p><span style=\"font-weight: 400;\">Terwujudnya pemerintah yang berdedikasi menuju kota Tegal yang bersih,demokratis,disiplin dan inovatif.</span></p>\r\n<h3><strong>Misi</strong></h3>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mewujudkan pemerintah yang bersih, profesional, akuntabel, berwibawa dan inovatif, berbasis teknologi informasi.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menciptakan atmosfir kehidupan kota Tegal yang lebih agamis, aman,kreatif,berbudaya,demokrasi, melindungi hak-hak anak dan perempuan untuk kesetaraan serta keadilan </span><em><span style=\"font-weight: 400;\">gender</span></em><span style=\"font-weight: 400;\">.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan pembangunan di bidang pendidikan, kesehatan, kesejahteraan pekerja dan masyarakat tidak mampu.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan infrastruktur, transportasi publik, lingkungan hidup yang bersih dan sehat serta pembangunan berkelanjutan yang berorientasi pada energi terbarukan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan kepariwisataan, investasi dan daya saing daerah serta mengembangkan ekonomi kerakyatan dan ekonomi kreatif.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengoptimalkan peran pemuda, pembinaan olah raga dan seni budaya.</span></li>\r\n</ol>', 'Publish', 'Profil', '', 'kota_tegal2.png', 'Visi Misi', 4, 1, NULL, NULL, '2022-07-07 09:17:05', '2022-07-07 09:16:36', '2022-07-21 21:00:09'),
(13, 4, 5, '', 'tugas-pokok-dan-fungsi', 'Tugas pokok dan Fungsi', '<p><span style=\"font-weight: 400;\">Tugas pokok dan Fungsi Kelurahan Randugunting Kota Tegal</span></p>\r\n<p><span style=\"font-weight: 400;\">Tugas pokok :</span></p>\r\n<p><span style=\"font-weight: 400;\">Kelurahan mempunyai tugas pokok penyelenggaraan pemerintahan, pembangunan dan sosial kemasyarakatan berdasarkan asas otonomi daerah dan tugas pembantuan dan tugas lain ynag dilimpahkan oleh Walikota.</span></p>\r\n<p><span style=\"font-weight: 400;\">Fungsi :</span></p>\r\n<p><span style=\"font-weight: 400;\">Dalam menyelenggarakan tugas pokok-pokok sebagaimana tersebut di atas, kelurahan memiliki fungsi :</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengkoordinasikan kegiatan pemerintahan tigkat kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengkoordinasikan kegiatan pemberdayaan masyarakat tingkat kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengkoordinasikan penyelenggaraan ketentraman dan ketertiban umum tingkat kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengkoordinasikan penerapan dan penegakkan peraturan perundang-undangan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Mengkoordinasikan pemeliharaan prasarana dan fasilitas pelayanan umum.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membina penyelenggaraan aparatur kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melaksanakan pelayanan masyarakat yang menjadi ruang lingkup tugasnya.</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Berdasarkan Peraturan Walikota Tegal Nomor 28 Tahun 2016 Penjabaran Tugas Pokok, Fungsi dan Tata Kerja Kecamatan dan Kelurahan Kota Tegal, adalah sebagai berikut :</span></p>\r\n<p><strong>Lurah</strong></p>\r\n<p><span style=\"font-weight: 400;\">Lurah mempunyai tugas membantu atau melaksanakan sebagian tugas camat dalam penyiapan bahan perumusan dan pelaksanaan kebijakan, pengoordinasian, pemantauan, evaluasi dan pelaporan, meliputi :&nbsp;</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pelaksanaan kegiatan pemerintahan kelurahan;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemberdayaan masyarakat;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pelayanan masyarakat;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemeliharaan ketenteraman dan ketertiban umum, dan pemeliharaan sarana dan prasarana serta fasilitas pelayanan umum.&nbsp;</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Lurah memimpin pelaksanaan tugas Lurah, membawahkan:&nbsp;</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Sekretariat;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Seksi Pemerintahan dan Pelayanan Masyarakat;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Seksi Pemberdayaan Masyarakat;&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Seksi Ketenteraman dan Ketertiban Umum</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Sekretariat</strong><span style=\"font-weight: 400;\"> mempunyai tugasa:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam melakukan penyiapan bahan perumusan.&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pengoordinasian, pelaksanaan, pemantauan, evaluasi serta pelaporan di bidang program, keuangan, umum dan kepegawaian, meliputi : pembinaan ketatausahaan, hukum, keuangan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pengelolaan barang milik daerah, kerumahtanggaan, kerjasama, kearsipan, dokumen, keorganisasian dan ketatalaksanaan, kehumasan, kepegawaian, pelayanan administrasi di lingkungan Kelurahan.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Seksi Pemerintahan dan Pelayanan Masyarakat</strong><span style=\"font-weight: 400;\"> mempunyai tugas:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam melakukan penyiapan bahan perumusan,&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pengoordinasian, pelaksanaan, pemantauan, evaluasi serta pelaporan di bidang pemerintahan dan pelayanan masyarakat, meliputi : penelaahan data/informasi sebagai bahan penyusunan rencana kerja di bidang pemerintahan dan pelayanan masyarakat tingkat kelurahan,&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemeliharaan sarana dan prasarana serta fasilitas pelayanan umum.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Seksi Pemberdayaan Masyarakat</strong><span style=\"font-weight: 400;\"> mempunyai tugas :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam melakukan penyiapan bahan perumusan.&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pengoordinasian, pelaksanaan, pemantauan, evaluasi serta pelaporan di bidang pemberdayaan masyarakat, meliputi : penelaahan data/informasi sebagai bahan penyusunan rencana kerja di bidang pemberdayaan masyarakat tingkat kelurahan.&nbsp;</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pelaksanaan penyelenggaraan kegiatan pemberdayaan masyarakat di tingkat kelurahan.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Seksi Ketenteraman dan Ketertiban Umum</strong><span style=\"font-weight: 400;\"> mempunyai tugas:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam melakukan penyiapan bahan perumusan, pengoordinasian, pelaksanaan, pemantauan, evaluasi serta pelaporan di bidang ketenteraman dan ketertiban umum, meliputi : penelaahan data/informasi sebagai bahan penyusunan rencana kerja di bidang ketenteraman dan ketertiban umum tingkat kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pelaksanaan penyelenggaraan kegiatan ketenteraman dan ketertiban umum ditingkat kelurahan</span></li>\r\n</ol>', 'Publish', 'Profil', '', NULL, 'Struktur', 22, 4, NULL, NULL, '2022-07-07 09:42:12', '2022-07-07 09:42:01', '2022-07-27 21:24:14'),
