(14, 4, 4, '', 'permohonan-surat-keterangan-tidak-mampu', 'Permohonan Surat Keterangan Tidak Mampu', '<p><strong>Badan Hukum</strong></p>\r\n<p><span style=\"font-weight: 400;\">Keputusan Walikota Kota Tegal Nomor 060 / 195 / 2017 tentang Standar Operasional Prosedur pada Kecamatan dan Kelurahan Kota Tegal</span></p>\r\n<p><strong>Syarat-Syarat Pengurusan Keterangan Tidak Mampu</strong></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Surat Pengantar dari RT/RW</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Fotocopy KTP dan Fotocopy KK 1 lembar</span></li>\r\n</ol>\r\n<p><strong>Mekanisme, Sistem dan Prosedur</strong></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan berkas oleh pemohon</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemeriksaan berkas dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Proses entry data</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penandatangan berkas</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penerbitan dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan dokumen</span></li>\r\n</ol>', 'Publish', 'Layanan', 'Permohonan Surat Keterangan Tidak Mampu', NULL, '', 4, 0, NULL, NULL, '2022-07-21 09:55:54', '2022-07-21 09:55:15', '2022-07-21 20:59:14'),
(11, 4, 5, '', 'profile', 'Profile', '<p><span style=\"font-weight: 400;\">Balai desa kelurahan randugunting pertama kali pada tahun 1884, dimana Raden Mas Tjilik menjabat sebagai kepala Desa Randugunting. Pemangkatan Raden Mas Tjilik menjadi kepela Desa Randugunting mengundang pergunjingan penduduk, karena :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menyimpan dari adat atau keturunan, diantaranya :</span></li>\r\n</ol>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Bukan keturunan Ki Gede Randugunting</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Bukan penduduk Randugunting, diduga berasal dari pekalongan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Keberadaanya ditunjuk oleh pemerintah Belanda untuk memimpin tanam paksa</span></li>\r\n</ol>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menjadi Kepala Desa Randugunting untuk kepentingan Belanda. Pada saat Raden Mas Tjilik menjabat sebagai Kepala Desa terjadi pemberontakan yang dikenal dengan pemberontakan Mas Tjilik. Dampak dari pemberontakan tersebut adalah :</span></li>\r\n</ol>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemerintahan atau ketertiban tidak terkendali.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Tanam paksa telah memiskinkan penduduk.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Kebodohan terjadi dimana-mana.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Dan dampak lain yang mempengaruhi situasi dan kondisi masyarakat yang menjadi semakin tidak baik. Akibat situasi dan kondisi masyarakat yang menjadi semakin tidak baik. Akibat situasi tersebut&nbsp; timbul pemberontakan masyarakat atas kepemimpinan Raden Mas Tjilik, dimana dalam pemberontakan tersebut Raden Mas Tjilik meninggal dunia sehingga Randugunting tidak memiliki seorang pemimpin. Pada akhirnya sistem pemerintahan menjadi kacau.</span></p>\r\n<p><span style=\"font-weight: 400;\">Kondisi tersebut mengundang perhatian dari Wasbian alias Bolang alias Kondor untuk membangun Desa Randugunting menjadi lebih baik. Hasil pembangunan yang dicapai mendapatkan perhatian pemerintah atasan dan akhirnya beliau diangkat dan ditetapkan menjadi Kepala Desa oleh pemerintah. Dengan pentunjuk pemerintah atasan disusunlah organisasi urusan sebagai berikut :</span></p>\r\n<p><span style=\"font-weight: 400;\">Kepala Desa </span> <span style=\"font-weight: 400;\">: Penanggung jawab Desa</span></p>\r\n<p><span style=\"font-weight: 400;\">Carik</span> <span style=\"font-weight: 400;\">: Pelaksana Administrasi</span></p>\r\n<p><span style=\"font-weight: 400;\">Bau Desa</span> <span style=\"font-weight: 400;\">: Pembantu Kepala Desa</span></p>\r\n<p><span style=\"font-weight: 400;\">Polisi Desa</span> <span style=\"font-weight: 400;\">: Penanggung jawab keamanan</span></p>\r\n<p><span style=\"font-weight: 400;\">Ulu &ndash; ulu </span> <span style=\"font-weight: 400;\">: Penanggung jawab pengairan lahan atau sawah pertanian</span></p>\r\n<p><span style=\"font-weight: 400;\">Kabayan</span> <span style=\"font-weight: 400;\">: Pelaksana tugas-tugas umum</span></p>\r\n<p><span style=\"font-weight: 400;\">&nbsp;</span> <span style=\"font-weight: 400;\">Berikut nama &ndash; nama Kepala Desa yang pernah menjadi Kepala Desa di Desa Randugunting dalam kurun waktu tertentu hingga sekarang :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"2\"><span style=\"font-weight: 400;\">Bapak Setjowordjojo</span> <span style=\"font-weight: 400;\">(Periode Th. 1919-1925)</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"2\"><span style=\"font-weight: 400;\">Bapak H.Moh.Usman</span> <span style=\"font-weight: 400;\">(Periode Th. 1925-1946)</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"2\"><span style=\"font-weight: 400;\">Bapak Karsid</span> <span style=\"font-weight: 400;\">(Periode Th. 1946-1975)</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"2\"><span style=\"font-weight: 400;\">Bapak Kasnan Sukirman</span> <span style=\"font-weight: 400;\">(Periode Th. 1975-1998)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Pada masa kepemimpinan Bapak Kasnan Sukirman Desa Randugunting berubah menjadi Kelurahan Randugunting yang pada saat itu merupakan satu-satunya kelurahan yang ada di wilayah kecamatan Tegal Selatan.</span></p>', 'Publish', 'Profil', '', NULL, 'Profile', 5, 3, NULL, NULL, '2022-07-07 09:15:51', '2022-07-07 09:14:52', '2022-07-21 20:42:51'),
