(20, 4, 5, '', 'permohonan-surat-keterangan-kelahiran', 'Permohonan Surat Keterangan Kelahiran', '<p><strong>Badan Hukum</strong></p>\r\n<p><span style=\"font-weight: 400;\">Keputusan Walikota Kota Tegal Nomor 060 / 195 / 2017 tentang Standar Operasional Prosedur pada Kecamatan dan Kelurahan Kota Tegal</span></p>\r\n<p><strong>Syarat-Syarat Pengurusan Surat Keterangan Kelahiran</strong></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Surat Pengantar dari RT/RW</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Fotocopy KTP dan Fotocopy KK 1 lembar</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Fotocopy Akta Nikah dan Fotocopy Keteranan Persalinan dari Bidan/Puskesmas/Rumah Sakit</span></li>\r\n</ol>\r\n<p><strong>Mekanisme, Sistem dan Prosedur</strong></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan berkas oleh pemohon</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemeriksaan berkas dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Proses entry data</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penandatangan berkas</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penerbitan dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan dokumen</span></li>\r\n</ol>', 'Publish', 'Layanan', 'Permohonan Surat Keterangan Kelahiran', NULL, '', 0, 0, NULL, NULL, '2022-07-21 10:01:06', '2022-07-21 10:00:49', '2022-07-21 03:01:06'),
(21, 4, 5, '', 'permohonan-surat-kematian', 'Permohonan Surat Kematian', '<p><strong>Badan Hukum</strong></p>\r\n<p><span style=\"font-weight: 400;\">Keputusan Walikota Kota Tegal Nomor 060 / 195 / 2017 tentang Standar Operasional Prosedur pada Kecamatan dan Kelurahan Kota Tegal</span></p>\r\n<p><strong>Syarat-Syarat Pengurusan Surat Kematian</strong></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Surat Pengantar dari RT/RW</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Fotocopy KTP dan Fotocopy KK 1 lembar</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melampirkan surat kematian dari dokter jika meninggal di Rumah Sakit</span></li>\r\n</ul>\r\n<p><strong>Mekanisme, Sistem dan Prosedur</strong></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan berkas oleh pemohon</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Pemeriksaan berkas dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Proses entry data</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penandatangan berkas</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penerbitan dokumen</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyerahan dokumen</span></li>\r\n</ol>', 'Publish', 'Layanan', 'Permohonan Surat Kematian', NULL, '', 0, 0, NULL, NULL, '2022-07-21 10:02:47', '2022-07-21 10:02:21', '2022-07-21 03:08:41'),
(27, 4, 5, '', 'karang-taruna', 'Karang Taruna', '<p><span style=\"font-weight: 400;\">Karang Taruna merupakan Lembaga Kemasyarakatan Kelurahan yang dibentuk sebagai wadah pengembangan generasi muda yang tumbuh dan berkembang atas dasar kesadaran dan rasa tanggung jawab sosial dari, oleh dan untuk masyarakat terutama generasi muda di wilayah Kelurahan terutama bergerak di bidang usaha kesejahteraan.</span></p>\r\n<p><span style=\"font-weight: 400;\">Tugas : membantu Lurah dalam menyelenggarakan pembinaan generasi muda dan kesejahteraan sosial</span></p>\r\n<table class=\"tiny-table\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NO</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">JABATAN</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">1.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Ketua I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">2.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Wakil Ketua I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">3.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sekretaris I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">4.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sekretaris II</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">5.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bendahara I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">6.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bendahara II</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Publish', 'Lembaga', '', NULL, '', 0, 2, NULL, NULL, '2022-07-28 04:31:31', '2022-07-28 04:31:07', '2022-07-27 21:31:31'),
(25, 4, 5, '', 'wilayah', 'Wilayah', '<p><strong>Keadaan Geografis :</strong></p>\r\n<p><span style=\"font-weight: 400;\">Kelurahan Randugunting merupakan salah satu dari 8 (delapan) kelurahan yang masuk dalam wilayah &ndash; wilayah Kecamatan Tegal Selatan Kota Tegal. Berikut letak geografis kelurahan Randugunting secara lengkap :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Luas Wilayah</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Luas Wilayah</span> <span style=\"font-weight: 400;\">: 137.85 Ha</span></p>\r\n<p><span style=\"font-weight: 400;\">Ketinggian rata-rata</span> <span style=\"font-weight: 400;\">: &plusmn; 2m di atas permukaan laut</span></p>\r\n<p><span style=\"font-weight: 400;\">Adapun peruntukan dari lahan di Kelurahan Randugunting adalah sebagai berikut :</span></p>\r\n<table class=\"tiny-table\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">No</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Pembentukan Lahan</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Luas Lahan</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Prosentase</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">1.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Pemukiman / Perumahan</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">111,50 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">80,88 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">2.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Perkantoran</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">1,00 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">0,72 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">3.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Pertanian</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">2,00 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">1,45 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">4.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Kuburan / Makam</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">3.93 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">2,86 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">5.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Taman&nbsp;</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">0,00 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">0,00 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">6.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Prasaran umum lainnya</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">19,42 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">14,09 %</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Jumlah</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">137,85 Ha</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">100 %</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Batas wilayah</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Batas wilayah kellurahan Randugunting adalah sebagai berikut :</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Sebelah utara</span> <span style=\"font-weight: 400;\">: Kelurahan Pekauman Kota Tegal</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Sebelah Timur</span> <span style=\"font-weight: 400;\">: Kelurahan Kejambon Kota Tegal</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Sebelah Selatan</span> <span style=\"font-weight: 400;\">: Kelurahan Debong Tengah dan Kelurahan Kejambon</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Sebelah Barat</span> <span style=\"font-weight: 400;\">: Kelurahan Debong Lor dan Kelurahan Kemandungan Tegal</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Kondisi Instansi Sekarang&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Secara topografi Kelurahan Randugunting Kecamatan Tegal Selatan terletak pada wilayah bagian Selatan Kota Tegal dengan kategori dataran rendah, memiliki ketinggian tanah antara 0-2 meter dari permukaan laut (dpl), membentang dari wilayah Timur hingga ke Barat dan Wilayah Selatan hingga Utara, sedangkan wilayah administrasi Kelurahan Randugunting Kecamatan Tegal Selatan memiliki luas 137,85 Ha yang mencakup 12 (dua belas) RW dan 84 (Delapan puluh empat) RT. Kondisi umum pemanfaatan lahan atau tanah saat ini adalah untuk pemukiman, pertanian, infrastruktur, perdagangan, fasilitas sosial budaya dan lain-lain. Berdasarkan kondisi tersebut dan sesuai dengan kriteria pertimbangan untuk wilayah Kelurahan Randugunting Kecamatan Tegal Selatan Kota Tegal diarahkan bagi peruntukan Penunjang Fungsi Perkotaan Tegal di masa mendatang.</span></p>', 'Publish', 'Profil', '', NULL, '', 2, 6, NULL, NULL, '2022-07-28 04:23:45', '2022-07-28 04:23:16', '2022-07-27 21:30:22'),
(26, 4, 5, '', 'pkk', 'PKK', '<p><span style=\"font-weight: 400;\">Lembaga kemasyarakatan kelurahan yang dibentuk dalam rangka pembangunan masyarakat yang tumbuh dari bawah yang pengelolaannya dari, oleh dan untuk masyarakat, menuju terwujudnya keluarga yang beriman dan bertaqwa kepada Tuhan Yang Maha Esa, berakhlak mulia dan berbudi luhur, sehat sejahtera, maju dan mandiri, kesejahteraan dan keadilan gender serta keadilan hukum.</span></p>\r\n<p><span style=\"font-weight: 400;\">Tugas :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Merencanakan, melaksanakan dan membina pelaksanaan program kerja PKK sesuai dengan keadaan dan kebutuhan masyarakat.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menghimpun, menggerakan dan membina potensi masyarakat khususnya keluarga untuk terlaksananya program kerja PKK.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Memberikan bimbingan, motivasi, dan memfasilitasi kelompok-kelompok PKK dibawahnya.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menyampaikan laporan tentang pelaksanaan kegiatan gerakan PKK kepada Lurah selaku Pembina TP PKK Kelurahan dan kepada TP PKK Kecamatan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melakukan penyusunan, pelaporan, evaluasi dan monitoring terhadap pelaksanaan program-program PKK.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Fungsi :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Penyuluh, motivator dan penggerak masyarakat agar mau dan mampu melaksanakan program PKK.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Fasilitator, perencana, pelaksana, pengendali, Pembina dan pembimbing gerakan PKK.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Susunan Tim Penggerak PKK :</span></p>\r\n<table class=\"tiny-table\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NO</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NAMA</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">JABATAN</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">1.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NY. SUSILOWATI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Ketua I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">2.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NY. KADARWATI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Wakil Ketua I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">3.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NY. AMIYATI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sekretaris I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">4.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NY. DWIYANI KUSTIYATI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sekretaris II</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">5.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">ILHAM SAWALI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bendahara I</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">6.</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">NY. IDA WURYANI</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bendahara II</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">7.&nbsp;</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: