(28, 4, 5, '', 'rukun-tetangga-rt', 'RUKUN TETANGGA (RT)', '<p><span style=\"font-weight: 400;\">Rukun Warga (RW) merupakan Lembaga Kemasyarakatan Kelurahan yang dibentuk melalui musyawarah Pengurus Rukun Tetangga di wilayah kerjanya yang ditetapkan oleh Lurah.</span></p>\r\n<p><span style=\"font-weight: 400;\">Tugas :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membatu Lurah dalam bidang pelayanan pemerintahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam menyediakan data kependudukan dan perizinan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melaksanakan tugas lain yang diberikan oleh Lurah.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Rukun Tetangga (RT) merupakan Lembaga Kemasyarakatan Kelurahan yang dibentuk melalui musyawarah masyarakat setempat dalam rangka pelayanan pemerintah dan kemasyarakatan yang ditetapkan oleh Lurah.</span></p>\r\n<p><span style=\"font-weight: 400;\">Tugas :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam bidang pelayaanan pemerintah</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam menyediakan data kependudukan dan perizinan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melaksanakan tugas lain yang diberikan oleh Lurah</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Susunan :</span></p>\r\n<table class=\"tiny-table\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">No</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Nama</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Jabatan</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ol>\r\n<li style=\"font-wei