(29, 4, 5, '', 'lembaga-pemberdayaan-masyarakat-lpmk', 'Lembaga Pemberdayaan Masyarakat (LPMK)', '<p><span style=\"font-weight: 400;\">Lembaga Pemberdayaan Masyarakat (LPMK) merupakan LKK yang dibentuk atas prakasa kelurahan dan masyarakat sebagai mitra kelurahan dalam menampung dan mewujudkan aspirasi dan kebutuhan masyarakat di bidang perencanaan pembangunan dan pemberdayaan.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Tugas :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam bidang pelayanan pemerintahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Membantu Lurah dalam menyediakan data kependudukan dan perizinan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Melaksanakan tugas lain yang diberikan oleh Lurah.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Fungsi :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menampung dan menyalurkan aspirasu masyarakat.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menanamkan dan menumpuk rasa persatuan dan kesatuan masyarakat.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan kualitas dan mempercepat pelayanan Pemerintah Kelurahan kepada masyarakat Kelurahan.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menyusun rencana, melaksanakan, mengendalikan, melestarikan, dan mengembangkan hasil pembangunan secara partisipatif.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Menumbuhkan, mengembangkan, dan menggerakan prakasa, partisipasi, swadaya, serta gotong royong masyarakat.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan kesejahteraan keluarga.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Meningkatkan kualitas sumber daya manusia.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<table class=\"tiny-table\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">No</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Nama</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Jabatan</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\">&nbsp;</li>\r\n</ol>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Ketua</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Moh. Imam Rosyidi, S.Pd, MM</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\">&nbsp;</li>\r\n</ol>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sekretaris</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Anggoro Panca Silawan, S.Pd</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\">&nbsp;</li>\r\n</ol>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bendahara</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Budi Fitriyanto, SH</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<ol>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\">&nbsp;</li>\r\n</ol>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang &ndash; Bidang :</span></p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"7\">&nbsp;</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Keagamaan</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">H. Slamet Saefurrohman, M.Si</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Pendidikan</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Urip Sofiyatun, S.Pd</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Pemuda dan OR</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Taufan Teguh Ariflanto</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Sosial</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Ahmad Zazuli</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Pembangunan dan Lingkungan Hidup</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Dedi Santoso, SH</span></p>\r\n<p><span style=\"font-weight: 400;\">H. Muharso</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Ekonomi Kreatif</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Wiryono Budiharjo, S.Kom</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Bidang Koperasi dan UKM</span></p>\r\n</td>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">Sri Endiyah Yuliani</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Publish', 'Lembaga', '', NULL, '', 0, 4, NULL, NULL, '2022-07-28 04:35:19', '2022-07-28 04:34:50', '2022-07-27 21:35:19'),
